Lexi Belle, Kris Slater, Brooklyn Lee, Xander Corvus

For the last several months, Ryan (Xander Corvus) has been coming inot the diner where Rachel (Lexi Belle) works. Is it the food, or does he want something that's not on the menu? Their attraction is obvious to everyone. When Ryan finally steps up to ask Rachel out, he finds her in the arms of another man (Kris Slater) and backs off. Looks can be deceiving however, and the other man is actually Rachel's visiting brother who eventually teams up with Rachel's best friend (Brooklyn Lee) to help track Ryan down and make sure the pair have another chance at love..
